&lt;script&gt;
  $(document).ready(function(){
    $(document).ready(function() {

      function showAlert(message, type) {
        const alertHTML = `
          &lt;div class=&quot;alert alert-${type} alert-dismissible fade show&quot; role=&quot;alert&quot;&gt;
            ${message}
          &lt;/div&gt;
        `;
        $(&#039;#alertPlaceholder&#039;).html(alertHTML);
      }

      // When the form is submitted
      $(&#039;#contact-form&#039;).on(&#039;submit&#039;, function(e) {
        e.preventDefault(); 

        // Example of form data to be sent via AJAX
        var formData = $(this).serialize(); 

        // Perform an AJAX POST request
        $.ajax({
          url: &quot;http://localhost/srujan_website_frontend/contact-us/save&quot;, 
          type: &#039;POST&#039;,
          data: formData,
          success: function(response) {
            // Assuming the response indicates success
            if(response.status===&quot;warning&quot;)
            {
              showAlert(response.message, &#039;warning&#039;);

            }else
            {
              showAlert(response.message, &#039;success&#039;);
            }
            // $.notify(&quot;Access granted&quot;, &quot;success&quot;); // Success notification
          },
          error: function(xhr, status, error) {
            // If there&#039;s an error
            $.notify(&quot;Warning: Self-destruct in 3.. 2..&quot;, &quot;warn&quot;); // Warning notification
            $.notify(&quot;BOOM!&quot;, &quot;error&quot;); // Error notification
          }
        });
      });
    });
  }
